import React, { useContext } from 'react'
import CardProdcut from './CardProdcut'
import { Appcontex } from '../App'


export default function Mycart() {

    const { cart } = useContext(Appcontex)
    function logcart(cart) {
        console.log(cart);
    }

    return (
        <div className="content-cart" >

            <div className="cart-added-list">

                <h2 onClick={logcart} className="cart-added-list__title">Корзина: </h2>

                <div className="cart-added-list__hold" id="js-cart-added-list">


                </div>

                <p className="cart-added-list__summ">
                    <span className="summ-label">Сума до оплати:</span>
                    <span className="summ-number">

                        <span className="js-cart-added-summ"> {cart}</span>
                        <span className="sums"> {cart.map(item =>
                            <h2>{item.price}</h2>
                        )

                        }</span>
                    </span>
                </p>
            </div>
        </div>



    )
}
